import React from 'react'
import './Search.css'
import search from '../../utils/search.svg'

const Search = () => {
  return (
    <div className='search'>
      <input type="search" placeholder="Enter keyword"/>
      <img src={search} alt='searchicon' />
    </div>
  )
}

export default Search
